const apiKey="kflsx3ko5oqjq3ogu9l3ypyw1ou6w25k",indexId="7p4s256sjngkmttu";function parseSearchResults(e){return e.matches.map(t=>({content:t.content,title:e.objects[t.objectId].properties.properties._title.text,url:e.objects[t.objectId].properties.properties._url.text}))}async function searchContents(e){const t=await fetch("https://api.operand.ai/operand.v1.ObjectService/SearchWithin",{method:"POST",headers:{"Content-Type":"application/json",Authorization:`${apiKey}`,"Operand-Index-ID":`${indexId}`},body:JSON.stringify({query:e,limit:10})});if(t.ok)return parseSearchResults(await t.json());console.error(t)}function debounce(e,t=200){let n;return(...s)=>{clearTimeout(n),n=setTimeout(()=>{e.apply(this,s)},t)}}registerHandlers(debounce(e=>{let t=e.target.value;t!==""&&searchContents(t).then(e=>displayResults(t,e))}))